sys_variable_value.value:
(function execute(inputs, outputs) {
  var gutils = new GoogleIdentityAccessUtils();
  var message = gutils.validateTheInputs(inputs);
  if (!message == 'Ok') { 
     throw new Error(message); 
  } 

  // Validate Private Key Types as per Google
  var allowedKeyTypes = ["TYPE_UNSPECIFIED", "TYPE_PKCS12_FILE", "TYPE_GOOGLE_CREDENTIALS_FILE"];
  if (allowedKeyTypes.indexOf(inputs.serviceAccountPrivateKeyType) == -1) {
     throw new Error("Not allowed  " + inputs.serviceAccountPrivateKeyType); 
  }  

  // Validate Service Account Key Algorithm
  var allowedAlgoTypes = ["KEY_ALG_UNSPECIFIED", "KEY_ALG_RSA_1024", "KEY_ALG_RSA_2048"];
  if (allowedAlgoTypes.indexOf(inputs.serviceAccountKeyAlgorithm) == -1) {
     throw new Error("Not allowed  " + inputs.serviceAccountKeyAlgorithm); 
  } 

  var payload = {
    privateKeyType: inputs.serviceAccountPrivateKeyType,
    keyAlgorithm: inputs.serviceAccountKeyAlgorithm    
  }

  outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

